        // Often used constants

        static const constexpr complex<double> myi = 1.0i;
        static const double lnhalf     = std::log(0.5);
        static const double ln2        = std::log(2.0);
        static const double ln4        = 2 * ln2;
        static const double ln64       = 6 * ln2;
        static const double ln256      = 8 * ln2;
        static const double ln2squ     = power_of<2>(std::log(2.0));
        static const double ln2cube    = power_of<3>(std::log(2.0));
        static const constexpr double pisqu      = power_of<2>(M_PI);
        static const constexpr double li2half    = 0.5822405264650124; // dilog(0.5)
